<?xml version="1.0"?>
<html xmlns:wicket="http://wicket.apache.org/">
  <body>
    <wicket:panel>
      <div class="gs-panel-SubProcessBuilder">
        <div class="process-builder">
          <form wicket:id="form">
            <div wicket:id="builder"/>
            <div class="button-group toolbar-sticky selfclear">
              <button wicket:id="apply" class="form-button-apply" type="submit">
                <wicket:message key="apply">apply</wicket:message>
              </button>
            </div>
          </form>
        </div>
      </div>
    </wicket:panel>
  </body>
</html>
